import React from 'react';

const CodeProject = (props) => {
  return (
    <div id={props.id} className="card--CodeProject">
      <img src={props.image} alt={props.name} className="card--img"/>
      <div className="card--text-container">
        <h2 className="card--title">{props.name}</h2>
        <a className="card--icon" href={props.links.code}><i class="fab fa-github-alt"></i></a>
        <a className="card--icon" href={props.links.web}><i class="fas fa-laptop-code"></i></a>
      </div>
    </div>
  )
}

export default CodeProject;

<div id={props.key}>
<div className="pokemon-img">
    <img src={props.image} alt={props.name}></img>
</div>
<div className="pokemon-info">
    <h1>{props.name}</h1>
    <ul className="pokemon-types">
        {props.pokemonTypes.map((singleType, index) =>
        <li key={index}>
            {singleType}
        </li>
        )}
    </ul>

</div>



</div>
